			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "#Load Google maps library from business SDK for Production build\n#Also load Settings bundle for Production build\nif [ $CONFIGURATION == \"Release\" ]; then\ncp -r $PROJECT_DIR/GoogleMapsM4B.framework/Versions/A/Resources/GoogleMaps.bundle $BUILT_PRODUCTS_DIR/$PRODUCT_NAME.app\nSETTINGS_BUNDLE_PATH=\"$PROJECT_DIR/CustomerManagerSystemiPad/Resources/ProductionSettings/Settings.bundle\"\ncp -r $SETTINGS_BUNDLE_PATH $BUILT_PRODUCTS_DIR/$PRODUCT_NAME.app\nfi\n\n#Load Google maps library from iOS SDK for free license to be used with internal releases\n#Also load Settings bundle for internal releases\nif [ $CONFIGURATION == \"Debug\" ] || [ $CONFIGURATION == \"Staging\" ] || [ $CONFIGURATION == \"Intg_Staging\" ]; then\ncp -r $PROJECT_DIR/GoogleMaps.framework/Versions/A/Resources/GoogleMaps.bundle $BUILT_PRODUCTS_DIR/$PRODUCT_NAME.app\nSETTINGS_BUNDLE_PATH=\"$PROJECT_DIR/CustomerManagerSystemiPad/Resources/StagingSettings/Settings.bundle\"\ncp -r $SETTINGS_BUNDLE_PATH $BUILT_PRODUCTS_DIR/$PRODUCT_NAME.app\nfi\n\n#Change Server Domain on Settings page as per the build type\nAPPS_SETTINGS_BUNDLE_PATH=\"$BUILT_PRODUCTS_DIR/$PRODUCT_NAME.app/Settings.bundle\"\n\nif [ $CONFIGURATION == \"Debug\" ]; then\nSERVER_DOMAIN=\"https://nexus.test.zsservices.com\"\n/usr/libexec/PlistBuddy \"$APPS_SETTINGS_BUNDLE_PATH/Root.plist\" -c \"Set PreferenceSpecifiers:3:DefaultValue $SERVER_DOMAIN\"\n\nelif [ $CONFIGURATION == \"Intg_Staging\" ]; then\nSERVER_DOMAIN=\"https://nexus.intgstaging.zsservices.com\"\n/usr/libexec/PlistBuddy \"$APPS_SETTINGS_BUNDLE_PATH/Root.plist\" -c \"Set PreferenceSpecifiers:3:DefaultValue $SERVER_DOMAIN\"\n\nelif [ $CONFIGURATION == \"Staging\" ]; then\nSERVER_DOMAIN=\"https://nexus.staging.zsservices.com\"\n/usr/libexec/PlistBuddy \"$APPS_SETTINGS_BUNDLE_PATH/Root.plist\" -c \"Set PreferenceSpecifiers:3:DefaultValue $SERVER_DOMAIN\"\nfi\n\n#Load bundle version from info.plist into Settings bundle for Production build\n#No need to change Server domain as we are not displaying it on Settings page for Production build\nif [ $CONFIGURATION == \"Release\" ]; then\nBUNDLE_SHORT_VERSION=$(/usr/libexec/PlistBuddy -c \"Print :CFBundleShortVersionString\" \"$PROJECT_DIR/CustomerManagerSystemiPad/Supporting Files/$PRODUCT_NAME-Info.plist\")\n/usr/libexec/PlistBuddy \"$APPS_SETTINGS_BUNDLE_PATH/Root.plist\" -c \"Set PreferenceSpecifiers:1:DefaultValue $BUNDLE_SHORT_VERSION\"\n\n#Change version on Settings page for internal releases\nelse\nAPP_VERSION=\"5.2.3\"\n/usr/libexec/PlistBuddy \"$APPS_SETTINGS_BUNDLE_PATH/Root.plist\" -c \"Set PreferenceSpecifiers:1:DefaultValue $APP_VERSION\"\nfi";
